  function addNote() {
    setNotes(...notes);
  }

  return (
    <div>
      <Header />
      <CreateArea onAdd={addNote} />

      {notes.map((note) => {
        return <Note key={note.id} title={note.title} content={note.content} />;
      })}
      <Note key={1} title="Note title" content="Note content" />
      <Footer />
    </div>
  );
}

export default App;
